import React from 'react';
import './App.css';


function NavMain(props) {
  return (
    <div>
      <p> This is NavMain func from NavMain.js </p>

      <Router>
          <ul> 
            <li><a href="index.html"> ToDo List </a></li>
			      <li><a href="index2.html"> Contact Form </a></li>
			      <li><a href="index3.html"> About </a></li>
          </ul>
      </Router>

    </div>

  )
}

export default NavMain;
